import axios from "axios";

const instance = axios.creatInstance = () => {
    return axios.create({
        baseURL: "http://10.232.79.182:8080/",
        headers: {
            'Access-Control-Allow-Origin': '*',
            'Content-Type': 'application/json'
        }
    });
};

export default creatInstance();
